/// [Current] example
void exampleOfCurrent() {
  print('~Start of Randomly Generated Current Example~');
  print(
      '1 Ampere + 1 Biot = ${const Current$Ampere(1) + const Current$Biot(1)}',);
  print(
      '1 Ampere + 1 EMUOfCurrent = ${const Current$Ampere(1) + const Current$EMUOfCurrent(1)}',);
  print(
      '1 Ampere + 1 CGSEMUnit with Precision = ${(const Current$Ampere(1) + const Current$CGSEMUnit(1)).withPrecision()}',);
  print(
      '1 Ampere + 1 CGSESUnit with Precision = ${(const Current$Ampere(1) + const Current$CGSESUnit(1)).withPrecision()}',);
  print(
      '1 EMUOfCurrent + 1 Ampere = ${const Current$EMUOfCurrent(1) + const Current$Ampere(1)}',);
  print(
      '1 EMUOfCurrent + 1 Milliampere = ${const Current$EMUOfCurrent(1) + const Current$Milliampere(1)}',);
  print(
      '2 EMUOfCurrent + 3 CGSESUnit with Precision ${(2.current$EMUOfCurrent + 3.current$CGSESUnit).withPrecision()}',);
  final listOfCurrent = [
    const Current$Kiloampere(2),
    const Current$EMUOfCurrent(2),
    const Current$ESUOfCurrent(1),
    const Current$CGSESUnit(3),
  ]..shuffle();
  print('Random Current List => $listOfCurrent');
  listOfCurrent.sort();
  print(
      'Largest to Smallest Current List => ${listOfCurrent.reversed.toList()}',);
  print(
      'Current List to Kiloampere with Precision => ${listOfCurrent.toKiloampere.withPrecision()}',);
  print('Current List to Ampere => ${listOfCurrent.toAmpere}');
  print('Current List to Biot => ${listOfCurrent.toBiot}');
  print('Current List to Abampere => ${listOfCurrent.toAbampere}');
  print('Current List to Statampere => ${listOfCurrent.toStatampere}');
  print(
      'Current List to ESUOfCurrent with Precision => ${listOfCurrent.toESUOfCurrent.withPrecision()}',);
  print(
      'Current List to CGSESUnit with Precision => ${listOfCurrent.toCGSESUnit.withPrecision()}',);
  const listOfCurrentByEnum = CurrentUnit.values;
  for (final e in listOfCurrentByEnum) {
    print('Access ${e.construct.runtimeType} with $e');
  }
  print('~End of Randomly Generated Current Example~');
  print(
      'Please open an issue or raise a PR on https://github.com/devsdocs/super_measurement if you find any mistake',);
  print('======================');
}

